import React, { useState, useEffect } from "react";
import axios from "axios";

const QbankMaster = () => {
  const [formData, setFormData] = useState({
    subcode: "",
    topcode: "",
    validity: "",
    difficulty: "",
    question: "",
    option1: "",
    option2: "",
    option3: "",
    option4: "",
    answer: "",
    reference: "",
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleInsert = async () => {
    try {
      await axios.post("http://your-php-api-url/insert.php", formData);
      alert("Data inserted successfully!");
    } catch (error) {
      console.error(error);
      alert("Failed to insert data!");
    }
  };

  const handleUpdate = async () => {
    try {
      await axios.post("http://your-php-api-url/update.php", formData);
      alert("Data updated successfully!");
    } catch (error) {
      console.error(error);
      alert("Failed to update data!");
    }
  };

  const handleDelete = async () => {
    try {
      await axios.post(
        `http://your-php-api-url/delete.php?id=${formData.qcode}`
      );
      alert("Data deleted successfully!");
    } catch (error) {
      console.error(error);
      alert("Failed to delete data!");
    }
  };

  return (
    <div>
      <h2>Qbank Page</h2>
      <form>
        <input
          type="text"
          name="subcode"
          value={formData.subcode}
          onChange={handleInputChange}
          placeholder="Subcode"
        />
        <input
          type="text"
          name="topcode"
          value={formData.topcode}
          onChange={handleInputChange}
          placeholder="Topcode"
        />
        <input
          type="text"
          name="validity"
          value={formData.validity}
          onChange={handleInputChange}
          placeholder="Validity"
        />
        <input
          type="text"
          name="difficulty"
          value={formData.difficulty}
          onChange={handleInputChange}
          placeholder="Difficulty"
        />
        <input
          type="text"
          name="question"
          value={formData.question}
          onChange={handleInputChange}
          placeholder="Question"
        />
        <input
          type="text"
          name="option1"
          value={formData.option1}
          onChange={handleInputChange}
          placeholder="Option 1"
        />
        <input
          type="text"
          name="option2"
          value={formData.option2}
          onChange={handleInputChange}
          placeholder="Option 2"
        />
        <input
          type="text"
          name="option3"
          value={formData.option3}
          onChange={handleInputChange}
          placeholder="Option 3"
        />
        <input
          type="text"
          name="option4"
          value={formData.option4}
          onChange={handleInputChange}
          placeholder="Option 4"
        />
        <input
          type="text"
          name="answer"
          value={formData.answer}
          onChange={handleInputChange}
          placeholder="Answer"
        />
        <input
          type="text"
          name="reference"
          value={formData.reference}
          onChange={handleInputChange}
          placeholder="Reference"
        />
        <button type="button" onClick={handleInsert}>
          Insert
        </button>
        <button type="button" onClick={handleUpdate}>
          Update
        </button>
        <button type="button" onClick={handleDelete}>
          Delete
        </button>
      </form>
    </div>
  );
};

export default QbankMaster;
